function ImagePopup(props) {
  return (
      <div className={`popup ${props.isOpen} popup_photo`} >
      <div className="popup__container">
        <img src={props.link} alt={props.name} className="popup__mask-group" />
        <h2 className="popup__phototitle"></h2>
        <button type="button" className="popup__close-icon" aria-label="закрыть форму"></button>
      </div>
    </div>
  );
}

export default ImagePopup;
